import Theme from '../styles/theme';
import build from '../components/pagebuild.json';
import {Row, Col} from '../components/elements';

function About() {

    return (
        <div className='body'>
            <Row height='600px' margin='40px' >
                <Col>
                    <div className='center sty'>
                        <img className='serviceimg' src='/icons/task.png'/>
                        <h2 className='servicetitle'>Services</h2>
                        <div className='sep'></div>
                        <ul className='services'>
                            {build.services.map((service, i) => {
                                return <li key={i}>{service}</li>
                            })}
                        </ul>
                    </div>
                </Col>
                <Col></Col>
            </Row>
            <style jsx>{`
                .center {
                    position: absolute;
                    top: 50%;
                    left: 50%;
                    display: flex;
                    justify-content: center;
                    flex-direction: column;
                    transform: translate(-50%,-50%);
                }
                .sty {
                    box-shadow: ${Theme.shadows.mat};
                    width: 80%;
                    border-radius: 20px;
                    padding: 20px;
                }
                .sep {
                    float: left;
                    width: 20px;
                    height: 3px;
                    background: ${Theme.colors.gunmetal};
                    margin: 10px 0;
                }
                .services {
                    float: left;
                    width: 100%;
                }
                .services li {
                    float: left;
                    width: 100%;
                    font: 16px 'Roboto';
                }
                .serviceimg {
                    float: left;
                    width: 100px;
                    height: 100px;
                }
                .servicetitle {
                    float: left;
                    width: 90%;
                    padding: 10px 5%;
                    font: 22px ${Theme.fonts.title};
                }
                .body {
                    float: left;
                    width: 100%;
                    margin-top: 90px;
                }
            `}</style>
        </div>
    )
}

export default About
